import React, { useEffect, useState } from 'react';
import logo from './logo.svg';
import './App.css';
import FontSelector from './FontSelector';

const fonts = [
  {
    name: 'ヒラギノ角ゴ ProN',
    style: ['W3', 'W6'],
  },
  {
    name: 'ヒラギノ角ゴ Pro',
    style: ['W3'],
  }
];

const Main = () => {
  return (
    <div className="App-header">
      <FontSelector props={fonts} />
    </div>
  );
}

const App: React.FC = () => {
  return (
    <div className="main">
      <Main />
    </div>
  );
}

export default App;
